nodes = pd.read_excel('nodes.xlsx')
nodes_dictionary = nodes.to_dict()
nodes_dictionary_labels = nodes_dictionary['Labels']
swapped_nodes_dict = {value: key for key, value in nodes_dictionary_labels.items()}

#Creating list of adges
edge_list = {'Source':[], 'Target':[], 'Type':[], 'From':[], 'To':[]}
for node in list(global_adjacency_list_1.keys()):
    connections = global_adjacency_list_1[node]
    for c in connections:
        edge_list['From'].append(node)
        edge_list['To'].append(c)
        edge_list['Type'].append('Directed')
        edge_list['Source'].append(swapped_nodes_dict[node])
        edge_list['Target'].append(swapped_nodes_dict[c])

